import React, { useState } from 'react';
import Carrocel from '../../components/Carrocel';
import SectionSlider from '../../components/Slider';

import { Container, CaroucelSection } from './styles';

import Slider from "react-slick";
import '../../styles/slick.css';
import { Section } from '../../styles/GlobalStyles';

import { carroucelInfo } from '../../assets/info';

export function Home() {

  const [info] = useState(carroucelInfo);

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 4,
    slidesToScroll: 1
  };
  return(
    <Container>
      <SectionSlider />

      <CaroucelSection>
        <Slider {...settings}>
          <Carrocel />
          <Carrocel />
          <Carrocel />
          <Carrocel />
          <Carrocel />
          <Carrocel />
          <Carrocel />
          <Carrocel />

        </Slider>
      </CaroucelSection>

      <Section style={{ background: '#e6e6e6'}}>

      </Section>

    </Container>
  );
};
